INSERT INTO `movie` VALUES (2,'Kill Bill','\"Kill Bill Vol. 1\" is a high-octane martial arts film directed by Quentin Tarantino. It follows the story of The Bride, portrayed by Uma Thurman, seeking revenge on her former colleagues who betrayed her and left her for dead on her wedding day. Packed with stylized violence, intricate fight scenes, and Tarantino\'s signature dialogue, the film is an adrenaline-fueled journey through vengeance and redemption.',2003,111,'English','United States','Quentin Tarantino','Action','https://i.pinimg.com/564x/86/96/4a/86964a87dc079243165707a7f8bce01d.jpg','https://www.youtube.com/watch?v=7kSuas6mRpk',_binary ''),(3,'Everything Everywhere All at Once','\"Everything Everywhere All at Once\" is a mind-bending sci-fi comedy-drama directed by Daniel Kwan and Daniel Scheinert, also known as Daniels. The film follows a middle-aged Chinese-American woman, played by Michelle Yeoh, who discovers that she is connected to multiple parallel universes. As she navigates these alternate realities, she must confront different versions of herself and embark on a surreal journey to save the multiverse from collapsing. Blending humor, action, and existential themes, the film offers a unique and visually stunning exploration of identity and existence.',2022,140,'English','United States','Daniel Scheinert, Daniel Kwan','Sci-fi','https://i.pinimg.com/736x/92/f5/ca/92f5cad155dddb98947805757256c56e.jpg','https://www.youtube.com/watch?v=wxN1T1uxQ2g',_binary '\0'),(4,'Little Women','\"Little Women\" is a classic novel by Louisa May Alcott, adapted into numerous films and TV series. Set during the American Civil War, it revolves around the lives of the four March sisters - Meg, Jo, Beth, and Amy - as they navigate the transition from childhood to womanhood. The story explores themes of love, family, ambition, and societal expectations, with each sister pursuing her own dreams and facing challenges along the way. Rich in character development and emotional depth, \"Little Women\" continues to resonate with audiences as a timeless coming-of-age tale.',2019,135,'English','United States','Greta Gerwig','Drama','https://i.pinimg.com/564x/ab/b3/43/abb34391cf21a83ed4ec01177f0e9503.jpg','https://www.youtube.com/watch?v=AST2-4db4ic&t=1s',_binary ''),(5,'Scarface','\"Scarface\" is a gritty crime drama directed by Brian De Palma and released in 1983. The film follows the rise and fall of Tony Montana, a Cuban immigrant played by Al Pacino, who becomes a powerful and ruthless drug lord in Miami. As Tony amasses wealth and influence, he succumbs to greed, paranoia, and violence, leading to his inevitable downfall. Fueled by iconic performances, intense action sequences, and memorable dialogue, \"Scarface\" has become a cult classic, known for its unflinching portrayal of the American Dream gone awry.',1983,169,'English','United States','Brian De Palma','Crime','https://i.pinimg.com/564x/04/dd/52/04dd52edb899efed7a8249b02ffe8062.jpg','https://www.youtube.com/watch?v=cv276Wg3e7I',_binary '\0'),(6,'The Truman Show','\"The Truman Show\" is a thought-provoking comedy-drama directed by Peter Weir, released in 1998. The film stars Jim Carrey as Truman Burbank, a man who unknowingly lives his entire life on a reality TV show broadcast worldwide. As Truman begins to question the artificiality of his surroundings and the truth of his existence, he embarks on a journey to break free from the meticulously constructed world around him. Blending satire with existential themes, \"The Truman Show\" offers a compelling exploration of media manipulation, personal identity, and the search for authenticity.',1998,103,'English','United States','Peter Weir','Comedy','https://i.pinimg.com/736x/0d/20/3c/0d203caaf2580e19ee125cb464adf2ff.jpg','https://www.youtube.com/watch?v=dlnmQbPGuls',_binary '\0'),(7,'The Dark Knight','\"The Dark Knight\" is a gripping superhero film directed by Christopher Nolan, released in 2008. Set in the gritty and realistic world of Gotham City, the film follows Batman, portrayed by Christian Bale, as he faces off against his most formidable foe yet, the Joker, played by Heath Ledger. As the Joker wreaks havoc and chaos across the city, Batman grapples with his own moral code and the limits of vigilantism. Known for its intense action sequences, complex characters, and Heath Ledger\'s iconic portrayal of the Joker, \"The Dark Knight\" is widely regarded as one of the greatest superhero films of all time.',2008,152,'English','United States','Christopher Nolan','Action','https://i.pinimg.com/564x/92/4f/4b/924f4b49253d15605651fe7cdde38d7b.jpg','https://www.youtube.com/watch?v=EXeTwQWrcwY',_binary '\0'),(8,'Amadeus','\"Amadeus\" is a captivating biographical drama directed by Miloš Forman, released in 1984. The film delves into the life of Wolfgang Amadeus Mozart, as seen through the eyes of his jealous rival, Antonio Salieri, played by F. Murray Abraham. Set in 18th century Vienna, Salieri wrestles with his own mediocrity in comparison to Mozart\'s undeniable genius. As Salieri schemes to undermine Mozart\'s success, he grapples with themes of envy, obsession, and the nature of artistic talent. \"Amadeus\" is renowned for its exquisite period detail, powerful performances, and stirring classical soundtrack, earning it critical acclaim and multiple Academy Awards, including Best Picture.',1984,180,'English','United States','Miloš Forman','Drama','https://i.pinimg.com/564x/8a/5b/2a/8a5b2a4ff4d548337673d86eff003db9.jpg','https://www.youtube.com/watch?v=r7kWQj9FCGY',_binary '\0'),(9,'Persona','\"Persona\" is a mesmerizing psychological drama directed by Ingmar Bergman, released in 1966. The film explores the complex relationship between a nurse named Alma and her mute patient, actress Elisabet Vogler. Set against the stark backdrop of a remote seaside cottage, the two women gradually blur the lines between their identities, leading to a profound and unsettling exploration of the nature of self, identity, and human connection. \"Persona\" is celebrated for its innovative cinematography, enigmatic storytelling, and profound themes, solidifying its status as a masterpiece of world cinema.',1966,83,'Swedish','Sweden','Ingmar Bergman','Drama','https://i.pinimg.com/736x/01/a2/09/01a2096685f3d46f97212c0cf0566135.jpg','https://www.youtube.com/watch?v=YEfJopPIbQg',_binary '\0'),(10,'TÁR','The film, set in the international world of classical music, centers on Lydia Tár, widely considered one of the greatest living composer/conductors and first-ever female chief conductor of a major German orchestra.',2022,158,'English','United States','Todd Field','Drama','https://i.pinimg.com/564x/11/31/19/113119623f24c9351c203b10375869c5.jpg','https://www.youtube.com/watch?v=Na6gA1RehsU',_binary ''),(11,'Do the Right Thing','\"Do the Right Thing\" is a powerful drama film directed by Spike Lee, released in 1989. Set on a scorching summer day in the Bedford-Stuyvesant neighborhood of Brooklyn, New York, the film follows a diverse cast of characters as tensions escalate between the residents and the local police, ultimately culminating in a tragic confrontation. Through its incisive exploration of racial tensions, prejudice, and systemic injustice, \"Do the Right Thing\" remains a landmark work in American cinema. Spike Lee\'s bold direction, vibrant cinematography, and provocative storytelling have cemented the film\'s status as a cultural touchstone, sparking vital conversations about race and social responsibility.',1989,120,'English','United States','Spike Lee','Drama','https://i.pinimg.com/564x/2a/19/ef/2a19ef0b8b0c019e7f0ae7636ace9de2.jpg','https://www.youtube.com/watch?v=yVAD4fYRcvA',_binary ''),(12,'Frances Ha','\"Frances Ha\" is a charming black-and-white comedy-drama directed by Noah Baumbach, released in 2012. The film follows the whimsical and endearing Frances Halladay, portrayed by Greta Gerwig, a young woman navigating life and friendship in New York City. As Frances grapples with career uncertainty, evolving relationships, and the challenges of adulthood, she embarks on a journey of self-discovery and personal growth. Shot in a naturalistic style with a vibrant soundtrack, \"Frances Ha\" captures the nuances of young adulthood with wit, warmth, and authenticity. Greta Gerwig\'s charismatic performance and Noah Baumbach\'s sharp writing make it a standout indie gem.',2012,86,'English','United States','Noah Baumbach','Drama','https://i.pinimg.com/564x/07/8f/39/078f39230d6c557521e5ff97433673cd.jpg','https://www.youtube.com/watch?v=YdxCnCvCngk',_binary '\0'),(13,'Moonlight','\"Moonlight\" is a poignant coming-of-age drama film directed by Barry Jenkins, released in 2016. The film tells the story of Chiron, a young black man growing up in Miami, Florida, as he grapples with his identity, sexuality, and place in the world. Divided into three chapters, each depicting a different stage of Chiron\'s life, \"Moonlight\" offers an intimate and lyrical exploration of masculinity, love, and the search for acceptance. With its sensitive direction, evocative cinematography, and powerful performances from its cast, including Mahershala Ali, Naomie Harris, and Trevante Rhodes, \"Moonlight\" received widespread critical acclaim, winning the Academy Award for Best Picture and earning praise for its profound emotional resonance and empathetic storytelling.',2016,111,'English','United States','Barry Jenkins','Drama','https://i.pinimg.com/564x/90/61/42/9061424c1413dfe4fd4e0688a18f4877.jpg','https://www.youtube.com/watch?v=9NJj12tJzqc',_binary '\0'),(14,'Poor Things','\"Poor Things\" is a forthcoming film directed by Yorgos Lanthimos, based on the novel of the same name by Alasdair Gray. The story is a darkly comic and satirical reimagining of the Frankenstein tale set in Victorian-era Scotland. The plot revolves around Belle Baxter, a young woman brought back to life through a bizarre scientific experiment by a mad scientist named Godwin Baxter. As Belle navigates her newfound existence, she grapples with questions of identity, agency, and freedom, while the people around her scheme and conspire. With Lanthimos\'s distinctive visual style and penchant for subverting genre conventions, \"Poor Things\" promises to be a unique and thought-provoking exploration of power, control, and the human condition.',2023,142,'English','Ireland','Yorgos Lanthimos','Sci-fi','https://i.pinimg.com/564x/13/b7/16/13b7169a4329b7a6ef83a026a305c916.jpg','https://www.youtube.com/watch?v=RlbR5N6veqw',_binary ''),(15,'The Godfather: Part II','\"The Godfather: Part II\" is a critically acclaimed crime drama directed by Francis Ford Coppola, released in 1974. Serving as both a sequel and prequel to \"The Godfather,\" the film follows the complex trajectory of Michael Corleone, portrayed by Al Pacino, as he expands his family\'s criminal empire and grapples with the consequences of his actions. The narrative interweaves Michael\'s rise to power in the 1950s with the story of his father, Vito Corleone, played by Robert De Niro, as he immigrates to America and establishes himself as a powerful mafia boss in the early 20th century. With its epic scope, intricate plotting, and powerhouse performances, \"The Godfather: Part II\" is widely regarded as one of the greatest films in cinematic history, earning numerous accolades, including six Academy Awards, including Best Picture and Best Director.',1974,202,'English','United States','Francis Ford Coppola','Crime','https://i.pinimg.com/564x/6c/92/a7/6c92a7aefc3cda63f27d234d714d9fe7.jpg','https://www.youtube.com/watch?v=9O1Iy9od7-A',_binary '\0'),(16,'They Cloned Tyrone','\"They Cloned Tyrone\" is an upcoming science fiction thriller film directed by Juel Taylor, which is set to be released on Netflix. The film follows the story of a group of friends in a neighborhood in Compton, Los Angeles, who stumble upon a strange conspiracy involving cloning. As they investigate further, they uncover dark secrets and mysteries that challenge their perceptions of reality. With its blend of sci-fi elements and social commentary, \"They Cloned Tyrone\" promises to offer a fresh and thought-provoking take on the genre.',2023,122,'English','United States','Juel Taylor','Comedy','https://i.pinimg.com/564x/f6/1e/ba/f61eba4ce6a4e24e655b0110a5ac67fd.jpg','https://www.youtube.com/watch?v=2S3M1xFVdVg',_binary '\0'),(17,'Beetlejuice','\"Beetlejuice\" is a dark fantasy comedy film directed by Tim Burton, released in 1988. The story revolves around a recently deceased couple, Adam and Barbara Maitland, who find themselves haunting their former home. When a new family, the Deetzes, moves in and begins to remodel the house, the Maitlands enlist the help of the mischievous and eccentric ghost Betelgeuse (pronounced \"Beetlejuice\") to scare them away. However, things quickly spiral out of control as Betelgeuse wreaks havoc on the living and the dead alike. With its quirky characters, inventive visuals, and macabre humor, \"Beetlejuice\" has become a beloved cult classic, known for its offbeat charm and memorable performances from Michael Keaton as Beetlejuice and Winona Ryder as Lydia Deetz.',1988,92,'English','United States','Tim Burton','Fantasy','https://i.pinimg.com/564x/0a/6f/ce/0a6fcedad1411589f7e12f34dcfa5003.jpg','https://www.youtube.com/watch?v=po1HJbmow0g',_binary '\0'),(18,'Midsommar','\"Midsommar\" is a psychological horror film directed by Ari Aster, released in 2019. The film follows a young woman named Dani, portrayed by Florence Pugh, who joins her boyfriend Christian and his friends on a trip to rural Sweden to attend a midsummer festival. However, what begins as a seemingly idyllic and quaint celebration soon turns sinister as the group becomes entangled in the disturbing rituals of a pagan cult. As tensions rise and the boundaries between reality and nightmare blur, Dani must confront her grief and navigate the increasingly surreal and horrifying events unfolding around her. With its unsettling atmosphere, stunning visuals, and intense performances, \"Midsommar\" has been praised for its unique approach to the horror genre and its exploration of themes such as grief, trauma, and the complexities of human relationships.',2019,147,'English','Sweden','Ari Aster','Horror','https://i.pinimg.com/564x/48/86/92/48869243758cb5d6413c0f5255ef5e2d.jpg','https://www.youtube.com/watch?v=1Vnghdsjmd0',_binary ''),(19,'Spirited Away','\"Spirited Away\" is a mesmerizing animated fantasy film directed by Hayao Miyazaki, released in 2001. The story follows a young girl named Chihiro, who becomes trapped in a mysterious and magical world after her parents are transformed into pigs by a curse. As Chihiro navigates this strange realm, she encounters a diverse cast of characters, both friendly and menacing, and must find a way to break the spell and return to the human world. Filled with imaginative creatures, breathtaking animation, and richly detailed landscapes, \"Spirited Away\" is celebrated for its enchanting storytelling, compelling themes, and visual splendor. The film won the Academy Award for Best Animated Feature and remains one of Studio Ghibli\'s most beloved and iconic works.',2001,125,'Japanese','Japan','Hayao Miyazaki','Animation','https://i.pinimg.com/564x/7b/20/60/7b2060adf9cb7dd2613aefced8528e77.jpg','https://www.youtube.com/watch?v=ByXuk9QqQkk',_binary ''),(20,'Cabaret','\"Cabaret\" is a musical drama film directed by Bob Fosse, released in 1972. Set in Berlin during the early 1930s, against the backdrop of the rise of the Nazi Party, the film follows the intertwining lives of an American writer named Cliff Bradshaw, played by Michael York, and a British cabaret performer named Sally Bowles, portrayed by Liza Minnelli. The story unfolds within the Kit Kat Club, a decadent nightclub where Sally performs, and explores themes of love, politics, and the clash between hedonism and oppression. With its electrifying musical numbers, evocative atmosphere, and powerhouse performances, \"Cabaret\" is hailed as a cinematic masterpiece, winning eight Academy Awards, including Best Director and Best Actress for Minnelli. It remains a timeless classic celebrated for its bold storytelling and unforgettable music.',1972,124,'English','United States','Bob Fosse','Drama','https://i.pinimg.com/564x/d1/d4/f9/d1d4f91b3ce114ad54f9845634285325.jpg','https://www.youtube.com/watch?v=EfL1J4QVhSM',_binary '\0'),(22,'The Addams Family','\"The Addams Family\" is a darkly comedic film directed by Barry Sonnenfeld, released in 1991. It brings the beloved characters from Charles Addams\' cartoons to life, focusing on the spooky yet endearing Addams family. The film follows the family\'s eccentricities and their interactions with the outside world, particularly when a con artist schemes to swindle them out of their fortune. Starring Raul Julia as Gomez, Anjelica Huston as Morticia, and Christina Ricci as Wednesday, the film captivates audiences with its blend of humor, charm, and macabre aesthetic.',1991,102,'English','United States','Barry Sonnenfeld','Comedy','https://i.pinimg.com/564x/f9/e7/7a/f9e77a734cbb9918bd74a96625155058.jpg','https://www.youtube.com/watch?v=A6X4VAHdDVg',_binary ''),(33,'One Flew Over the Cuckoo’s Nest','IF HE’S CRAZY, WHAT DOES THAT MAKE YOU?\nWhile serving time for insanity at a state mental hospital, implacable rabble-rouser, Randle Patrick McMurphy, inspires his fellow patients to rebel against the authoritarian rule of head nurse, Mildred Ratched.',1975,133,'English','United States','Miloš Forman','Drama','https://i.pinimg.com/564x/32/6b/37/326b37dbeb46abea47b81fc09ceeecff.jpg','https://www.youtube.com/watch?v=OXrcDonY-B8',_binary '');
